<!doctype html>
<html lang="en">
    <head>
        <meta charset="utf-8">
        <meta http-equiv="X-UA-Compatible" content="IE=edge">
        <meta name="viewport" content="initial-scale=1,user-scalable=no,maximum-scale=1,width=device-width">
        <meta name="mobile-web-app-capable" content="yes">
        <meta name="apple-mobile-web-app-capable" content="yes">
        <link rel="stylesheet" href="css/leaflet.css">
        <link rel="stylesheet" href="css/qgis2web.css"><link rel="stylesheet" href="css/fontawesome-all.min.css">
        <style>
        #map {
            width: 1310px;
            height: 791px;
        }
        </style>
        <title></title>
    </head>
    <body>
        <div id="map">
        </div>
        <script src="js/qgis2web_expressions.js"></script>
        <script src="js/leaflet.js"></script>
        <script src="js/leaflet.rotatedMarker.js"></script>
        <script src="js/leaflet.pattern.js"></script>
        <script src="js/leaflet-hash.js"></script>
        <script src="js/Autolinker.min.js"></script>
        <script src="js/rbush.min.js"></script>
        <script src="js/labelgun.min.js"></script>
        <script src="js/labels.js"></script>
        <script>
        var map = L.map('map', {
            zoomControl:true, maxZoom:28, minZoom:1
        }).fitBounds([[41.542156892564435,-85.99723177658488],[41.74458520834134,-85.54816561447525]]);
        var hash = new L.Hash(map);
        map.attributionControl.setPrefix('<a href="https://github.com/tomchadwin/qgis2web" target="_blank">qgis2web</a> &middot; <a href="https://leafletjs.com" title="A JS library for interactive maps">Leaflet</a> &middot; <a href="https://qgis.org">QGIS</a>');
        var autolinker = new Autolinker({truncate: {length: 30, location: 'smart'}});
        var bounds_group = new L.featureGroup([]);
        function setBounds() {
        }
        map.createPane('pane_EsriTerrain_0');
        map.getPane('pane_EsriTerrain_0').style.zIndex = 400;
        var layer_EsriTerrain_0 = L.tileLayer('https://server.arcgisonline.com/ArcGIS/rest/services/World_Terrain_Base/MapServer/tile/{z}/{y}/{x}', {
            pane: 'pane_EsriTerrain_0',
            opacity: 1.0,
            attribution: '',
            minZoom: 1,
            maxZoom: 28,
            minNativeZoom: 0,
            maxNativeZoom: 13
        });
        layer_EsriTerrain_0;
        map.addLayer(layer_EsriTerrain_0);
        map.createPane('pane_EsriSatellite_1');
        map.getPane('pane_EsriSatellite_1').style.zIndex = 401;
        var layer_EsriSatellite_1 = L.tileLayer('https://server.arcgisonline.com/ArcGIS/rest/services/World_Imagery/MapServer/tile/{z}/{y}/{x}', {
            pane: 'pane_EsriSatellite_1',
            opacity: 1.0,
            attribution: '',
            minZoom: 1,
            maxZoom: 28,
            minNativeZoom: 0,
            maxNativeZoom: 17
        });
        layer_EsriSatellite_1;
        map.addLayer(layer_EsriSatellite_1);
        map.createPane('pane_n41_w086_1arc_v3_2');
        map.getPane('pane_n41_w086_1arc_v3_2').style.zIndex = 402;
        var img_n41_w086_1arc_v3_2 = 'data/n41_w086_1arc_v3_2.png';
        var img_bounds_n41_w086_1arc_v3_2 = [[40.99986111111111,-86.00013888888888],[42.000138888888884,-84.9998611111111]];
        var layer_n41_w086_1arc_v3_2 = new L.imageOverlay(img_n41_w086_1arc_v3_2,
                                              img_bounds_n41_w086_1arc_v3_2,
                                              {pane: 'pane_n41_w086_1arc_v3_2'});
        bounds_group.addLayer(layer_n41_w086_1arc_v3_2);
        map.addLayer(layer_n41_w086_1arc_v3_2);
        map.createPane('pane_Aspect_3');
        map.getPane('pane_Aspect_3').style.zIndex = 403;
        var img_Aspect_3 = 'data/Aspect_3.png';
        var img_bounds_Aspect_3 = [[40.99986111111111,-86.00013888888888],[42.000138888888884,-84.9998611111111]];
        var layer_Aspect_3 = new L.imageOverlay(img_Aspect_3,
                                              img_bounds_Aspect_3,
                                              {pane: 'pane_Aspect_3'});
        bounds_group.addLayer(layer_Aspect_3);
        map.addLayer(layer_Aspect_3);
        map.createPane('pane_Slope_4');
        map.getPane('pane_Slope_4').style.zIndex = 404;
        var img_Slope_4 = 'data/Slope_4.png';
        var img_bounds_Slope_4 = [[40.99986111111111,-86.00013888888888],[42.000138888888884,-84.9998611111111]];
        var layer_Slope_4 = new L.imageOverlay(img_Slope_4,
                                              img_bounds_Slope_4,
                                              {pane: 'pane_Slope_4'});
        bounds_group.addLayer(layer_Slope_4);
        map.addLayer(layer_Slope_4);
        map.createPane('pane_EsriBoundariesPlaces_5');
        map.getPane('pane_EsriBoundariesPlaces_5').style.zIndex = 405;
        var layer_EsriBoundariesPlaces_5 = L.tileLayer('https://server.arcgisonline.com/ArcGIS/rest/services/Reference/World_Boundaries_and_Places/MapServer/tile/{z}/{y}/{x}', {
            pane: 'pane_EsriBoundariesPlaces_5',
            opacity: 1.0,
            attribution: '',
            minZoom: 1,
            maxZoom: 28,
            minNativeZoom: 0,
            maxNativeZoom: 20
        });
        layer_EsriBoundariesPlaces_5;
        map.addLayer(layer_EsriBoundariesPlaces_5);
        setBounds();
        L.ImageOverlay.include({
            getBounds: function () {
                return this._bounds;
            }
        });
        </script>
    </body>
</html>
